package com.symantec.vip.automation.eg.pages;import java.util.List;import org.openqa.selenium.WebDriver;import org.openqa.selenium.WebElement;import org.openqa.selenium.support.FindBy;import org.openqa.selenium.support.How;public class AddVIPCertificatePage extends Page {	@FindBy(how = How.NAME, using = "pkcsFile")	public WebElement Button_BrowseCertificate;	@FindBy(how = How.NAME, using = "pkcsPassword")	public WebElement TextBox_CertificatePasswords;	@FindBy(how = How.NAME, using = "method:doIt")	public WebElement Button_Submit;	@FindBy(how = How.ID, using = "autoRa_key_alias")	public WebElement Alias_Field;	@FindBy(how = How.XPATH, using = "//table[@id='list_valid']/descendant::tr")	public List<WebElement> CertificatesList_Table;	@FindBy(how = How.XPATH, using = "//div[@id='list_valid_toppager']/descendant::table[2]/descendant::td[6]")	public WebElement Pagination_Table;	@FindBy(how = How.XPATH, using = "//input[@class='ui-pg-input' and @type='text']")	public WebElement PageNo_TextBox;	@FindBy(how = How.LINK_TEXT, using = "VIP Certificate")	public WebElement VIPCertificate_link;	@FindBy(how = How.NAME, using = "method:add")	public WebElement Button_AddVIPCertificate;	@FindBy(how = How.XPATH, using = ".//*[@id='errors-inpage']/div/div")	public WebElement Message_on_page;	public AddVIPCertificatePage(WebDriver webDriver) {		super(webDriver);	}}